INSERT INTO film (id, award, name, genre, duration, year, main_actor_id, director_id, description, image) VALUES
('e3661c31-d1a4-47ab-94b6-1c6500dccf46', 'OSCAR', 'Inglourious Basterds', 'WAR', 153, 2009, 'e3661c31-d1a4-47ab-94b6-1c6500dccf41', 'e3661c31-d1a4-47ab-94b6-1c6500dccf26', 'In Nazi-occupied France during World WAR II, a plan to assassinate Nazi leaders by a group of Jewish U.S. soldiers coincides with a theatre owner''s vengeful plans for the same.','data:image/png;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf47', 'BAFTA', 'The Dark Knight', 'ACTION', 152, 2008, 'e3661c31-d1a4-47ab-94b6-1c6500dccf42', 'e3661c31-d1a4-47ab-94b6-1c6500dccf27', 'When the menace known as The Joker emerges from his mysterious past, he wreaks havoc and chaos on the people of Gotham, the Dark Knight must accept one of the greatest psychological and physical tests of his ability to fight injustice.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf48', 'OSCAR', 'The Godfather', 'CRIME', 175, 1972, 'e3661c31-d1a4-47ab-94b6-1c6500dccf40', 'e3661c31-d1a4-47ab-94b6-1c6500dccf28', 'The aging patriarch of an organized crime dynasty transfers control of his clandestine empire to his reluctant son.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf49', '', 'Forrest Gump', 'DRAMA', 142, 1994, 'e3661c31-d1a4-47ab-94b6-1c6500dccf36', 'e3661c31-d1a4-47ab-94b6-1c6500dccf31', 'The presidencies of Kennedy and Johnson, the events of Vietnam, Watergate and other historical events unfold from the perspective of an Alabama man with an IQ of 75, whose only desire is to be reunited with his childhood sweetheart.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf50', 'BAFTA', 'Titanic', 'ROMANCE', 195, 1997, 'e3661c31-d1a4-47ab-94b6-1c6500dccf45', 'e3661c31-d1a4-47ab-94b6-1c6500dccf32', 'A seventeen-year-old aristocrat falls in love with a kind but poor artist aboard the luxurious, ill-fated R.M.S. Titanic.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf51', '', 'Jurassic Park', 'ADVENTURE', 127, 1993, 'e3661c31-d1a4-47ab-94b6-1c6500dccf42', 'e3661c31-d1a4-47ab-94b6-1c6500dccf31', 'During a preview tour, a theme park suffers a major power breakdown that allows its cloned dinosaur exhibits to run amok.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf52', 'OSCAR', 'La La Land', 'MUSIC', 128, 2016, 'e3661c31-d1a4-47ab-94b6-1c6500dccf39', 'e3661c31-d1a4-47ab-94b6-1c6500dccd36', 'While navigating their careers in Los Angeles, a pianist and an actress fall in love while attempting to reconcile their aspirations for the future.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf53', 'GOLDEN_GLOBE', 'The Shawshank Redemption', 'DRAMA', 142, 1994, 'e3661c31-d1a4-47ab-94b6-1c6500dccf40', 'e3661c31-d1a4-47ab-94b6-1c6500dccf28', 'Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf54', 'BAFTA', 'The Lord of the Rings: The Fellowship of the Ring', 'THRILLER', 178, 2001, 'e3661c31-d1a4-47ab-94b6-1c6500dccf42', 'e3661c31-d1a4-47ab-94b6-1c6500dccf34', 'A meek Hobbit from the Shire and eight companions set out on a journey to destroy the powerful One Ring and save Middle-earth from the Dark Lord Sauron.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf55', '', 'The Matrix', 'ACTION', 136, 1999, 'e3661c31-d1a4-47ab-94b6-1c6500dccf42', 'e3661c31-d1a4-47ab-94b6-1c6500dccd37', 'A computer hacker learns from mysterious rebels about the true nature of his reality and his role in the WAR against its controllers.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf56', 'OSCAR', 'The Silence of the Lambs', 'CRIME', 118, 1991, 'e3661c31-d1a4-47ab-94b6-1c6500dccf40', 'e3661c31-d1a4-47ab-94b6-1c6500dccf28', 'A young F.B.I. cadet must receive the help of an incarcerated and manipulative cannibal killer to help catch another serial killer, a madman who skins his victims.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf57', 'GOLDEN_GLOBE', 'Gladiator', 'ACTION', 155, 2000, 'e3661c31-d1a4-47ab-94b6-1c6500dccf42', 'e3661c31-d1a4-47ab-94b6-1c6500dccf35', 'A former Roman General sets out to exact vengeance against the corrupt emperor who murdered his family and sent him into slavery.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf58', '', 'Avatar', 'ADVENTURE', 162, 2009, 'e3661c31-d1a4-47ab-94b6-1c6500dccf43', 'e3661c31-d1a4-47ab-94b6-1c6500dccf32', 'A paraplegic Marine dispatched to the moon Pandora on a unique mission becomes torn between following his orders and protecting the world he feels is his home.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf59', 'OSCAR', 'Interstellar', 'ADVENTURE', 169, 2014, 'e3661c31-d1a4-47ab-94b6-1c6500dccf41', 'e3661c31-d1a4-47ab-94b6-1c6500dccf27', 'A team of explorers travel through a wormhole in space in an attempt to ensure humanity''s survival.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf68', '', 'Inception', 'SCIENCE_FICTION', 148, 2010, 'e3661c31-d1a4-47ab-94b6-1c6500dccf42', 'e3661c31-d1a4-47ab-94b6-1c6500dccd37', 'A thief who steals corporate secrets through the use of dream-sharing technology is given the inverse task of planting an idea into the mind of a C.E.O.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf60', 'OSCAR', 'The Departed', 'CRIME', 151, 2006, 'e3661c31-d1a4-47ab-94b6-1c6500dccf40', 'e3661c31-d1a4-47ab-94b6-1c6500dccf28', 'An undercover cop and a mole in the police attempt to identify each other while infiltrating an Irish gang in South Boston.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf61', '', 'Fight Club', 'DRAMA', 139, 1999, 'e3661c31-d1a4-47ab-94b6-1c6500dccf40', 'e3661c31-d1a4-47ab-94b6-1c6500dccf35', 'An insomniac office worker and a devil-may-care soapmaker form an underground fight club that evolves into something much, much more.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf63', 'BAFTA', 'The Prestige', 'DRAMA', 130, 2006, 'e3661c31-d1a4-47ab-94b6-1c6500dccf42', 'e3661c31-d1a4-47ab-94b6-1c6500dccf27', 'After a tragic accident, two stage magicians engage in a battle to create the ultimate illusion while sacrificing everything they have to outwit each other.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf64', 'GOLDEN_GLOBE', 'Black Panther', 'ACTION', 134, 2018, 'e3661c31-d1a4-47ab-94b6-1c6500dccf43', 'e3661c31-d1a4-47ab-94b6-1c6500dccf31', 'T\''Challa, heir to the hidden but advanced kingdom of Wakanda, must step forWARd to lead his people into a new future and must confront a challenger from his country\''s past.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf65', '', 'The Social Network', 'BIOGRAPHY', 120, 2010, 'e3661c31-d1a4-47ab-94b6-1c6500dccf42', 'e3661c31-d1a4-47ab-94b6-1c6500dccd38', 'As Harvard student Mark Zuckerberg creates the social networking site that would become known as Facebook, he is sued by the twins who claimed he stole their idea, and by the co-founder who was later squeezed out of the business.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf69', '', 'The Green Mile', 'CRIME', 189, 1999, 'e3661c31-d1a4-47ab-94b6-1c6500dccf40', 'e3661c31-d1a4-47ab-94b6-1c6500dccf28', 'The lives of guards on Death Row are affected by one of their charges: a black man accused of child murder and rape, yet who has a mysterious gift.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf73', 'BAFTA', 'The Godfather: Part II', 'CRIME', 202, 1974, 'e3661c31-d1a4-47ab-94b6-1c6500dccf40', 'e3661c31-d1a4-47ab-94b6-1c6500dccf28', 'The early life and career of Vito Corleone in 1920s New York City is portrayed, while his son, Michael, expands and tightens his grip on the family crime syndicate.','data:image/jpeg;base64,'),
('e3661c31-d1a4-47ab-94b6-1c6500dccf74', '', 'The Dark Knight Rises', 'ACTION', 164, 2012, 'e3661c31-d1a4-47ab-94b6-1c6500dccf42', 'e3661c31-d1a4-47ab-94b6-1c6500dccd37', 'Eight years after the Joker''s reign of anarchy, Batman, with the help of the enigmatic Catwoman, is forced from his exile to save Gotham City from the brutal guerr','data:image/jpeg;base64,')
